//SPDX-License-Identifier: Unlicense
pragma solidity >= 0.5.0 < 0.9.0;

contract Main{
    struct information{
        string name;
        string lname;
        string email;
        string password;
        string comPassword;
    }

    mapping(address => information) public informations;

    event str(string,string,string,string,string);

    function Set(string memory _name,string memory _lname,string memory _email,string memory _password,string memory _comPassword)public {
        // information storage info = informations[msg.sender];
        // info.name = _name;
        // info.lname = _lname;
        // info.email = _email;
        // info.password = _password;
        // info.comPassword = _comPassword;

        // emit str(_name,_lname,_email,_password,_comPassword);

        informations[msg.sender].name = _name;
        informations[msg.sender].lname = _lname;
        informations[msg.sender].email = _email;
        informations[msg.sender].password = _password;
        informations[msg.sender].comPassword = _comPassword;

        
    }

    function Get(address _address)public view returns(string memory,string memory,string memory,string memory,string memory){
        return (informations[_address].name,informations[_address].lname,informations[_address].email,informations[_address].password,informations[_address].comPassword);
    } 


}
